  selector: 'app-navbar',
  templateUrl: './navbar.component.html',
  styleUrls: ['./navbar.component.css']
})
export class NavbarComponent {

  constructor(private auth:AuthService,private route:Router){

  }

  logout(){
    this.auth.logout();
    this.route.navigateByUrl('');

  }

}

